import React from 'react'

function ButtonFilter({button, filter}) {

    useEffect(() => {
        axios
            .get('http://127.0.0.1:8000/api/v1/internship')
            .then((res) => {
                console.log(res.data);
                setData(res.data);
                
            })
            .catch((err) => {
                console.log(err);
            }); 
    }, []);
    
    return (
        <div>
           <button type="button" onClick={()=> filter('Bank Indonesia Internship')}>ProgramName</button>
        </div>
    )
}

export default ButtonFilter;
